The main benefit of GATs is to get rid of odd patterns that were introduced in Sophia in order to keep it generic enough to support multiple implementation choices. The drawback of this approach was that implementing Sophia's traits (especially Graph and Dataset) could be cumbersome. As an example, the Graph trait used to be pub trait Graph { type Triple: TripleStreamingMode; // ...
} Given a type MyGraph implementing that trait, the actual type of triples yielded by MyGraph::triples could not be immediately determined, and was quite intricate . This could be inconvenient for some users of MyGraph, and was usually cumbersome for the implementer. Compare to the new definition of the Graph trait: pub trait Graph { type Triple<'x>: Triple where Self: 'x; // ...
} where Graph::triples now yield triples whose type is exactly Graph::Triple<'_>. Much easier. The same pattern existed for Dataset , TripleSource , and QuadSource , where GATs have now also replaced it.

