In version 0.7, the Graph trait had a number of specialized methods for retrieving selected triples, such as triples_with_s or triples_with_po (and similarly for Dataset: quads_with_s, etc.). All these methods have disappeared in favor of triples_matching , so that instead of: for t in g.triples_with_s(mys) { // ...
} one should now write # extern crate sophia;
# use sophia::api::graph::Graph;
# use sophia::api::term::matcher::Any;
# let g: Vec<[i32; 3]> = vec![]; // dummy graph type
# let mys = 42;
for t in g.triples_matching([mys], Any, Any) { // ...
} and the performances will be the same (depending, of course, of how carefully the Graph/Dataset was implemented, but that was already the case with the previous API).

